import React, { useState } from 'react';
import { rgbToCmyk, cmykToRgb, rgbToXyz, xyzToLab, labToXyz, xyzToRgb } from './colorUtils'; // Импортируйте функции

function ColorPicker() {
  const [colorRGB, setColorRGB] = useState({ r: 255, g: 0, b: 0 });
  const [colorCMYK, setColorCMYK] = useState({ c: 0, m: 0, y: 0, k: 0 });
  const [colorLAB, setColorLAB] = useState({ l: 0, a: 0, b: 0 });

  // Обновление цвета при вводе
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    const newValue = Math.max(0, Math.min(255, Number(value))); // Ограничение 0-255
    setColorRGB(prev => {
      const newColor = { ...prev, [name]: newValue };
      updateColors(newColor);
      return newColor;
    });
  };

  // Обновление цвета через ползунок
  const handleSliderChange = (e) => {
    const { name, value } = e.target;
    const newValue = Number(value);
    setColorRGB(prev => {
      const newColor = { ...prev, [name]: newValue };
      updateColors(newColor);
      return newColor;
    });
  };

  // Обновление всех цветовых моделей
  const updateColors = (rgb) => {
    const cmyk = rgbToCmyk(rgb.r, rgb.g, rgb.b);
    const xyz = rgbToXyz(rgb.r, rgb.g, rgb.b);
    const lab = xyzToLab(xyz.x, xyz.y, xyz.z);

    setColorCMYK(cmyk);
    setColorLAB(lab);
  };

  // Обработка выбора цвета из палитры
  const handleColorPickerChange = (e) => {
    const hex = e.target.value;
    const bigint = parseInt(hex.slice(1), 16);
    const r = (bigint >> 16) & 255;
    const g = (bigint >> 8) & 255;
    const b = bigint & 255;
    const rgb = { r, g, b };
    setColorRGB(rgb);
    updateColors(rgb);
  };

  const rgbColor = `rgb(${colorRGB.r}, ${colorRGB.g}, ${colorRGB.b})`;

  return (
    <div>
      <h2>Color Picker (RGB)</h2>
      <div className="color-box" style={{ backgroundColor: rgbColor }}>
        {rgbColor}
      </div>
      <div>
        <label>R:
          <input type="number" name="r" value={colorRGB.r} onChange={handleInputChange} max="255" min="0" />
        </label>
        <label>G:
          <input type="number" name="g" value={colorRGB.g} onChange={handleInputChange} max="255" min="0" />
        </label>
        <label>B:
          <input type="number" name="b" value={colorRGB.b} onChange={handleInputChange} max="255" min="0" />
        </label>
      </div>
      <div>
        <label>R:
          <input type="range" name="r" value={colorRGB.r} onChange={handleSliderChange} max="255" min="0" />
        </label>
        <label>G:
          <input type="range" name="g" value={colorRGB.g} onChange={handleSliderChange} max="255" min="0" />
        </label>
        <label>B:
          <input type="range" name="b" value={colorRGB.b} onChange={handleSliderChange} max="255" min="0" />
        </label>
      </div>
      <button onClick={() => document.getElementById('colorPicker').click()}
        style={{ padding: '10px 20px', cursor: 'pointer', marginTop: '20px' }}>
        Выбрать цвет из палитры
      </button>
      <input id="colorPicker" type="color" value={rgbColor} onChange={handleColorPickerChange} style={{ display: 'none' }} />
    </div>
  );
}

export default ColorPicker;
